import EventCarousel from "./eventCarousel";

export default function PopularEvents(){
    return(
        <div className="h-screen w-screen">
            <div className="grid grid-rows-5 grid-cols-7 h-screen border-2 border-white">
                <div className="mx-36 row-span-3 col-span-5 h-full w-full text-white">
                    psst... check out our most popular events
                </div>
                <div className="row-span-2 col-span-7 self-end w-full">
                    <EventCarousel/>
                </div>
            </div>
        </div>
    );
}
